import "./App.css";
//import { Task } from "./components/task.tsx";
import { Sidebar } from "./components/sidebar.tsx";
import { Infobar } from "./components/infobar.tsx";
import { Planned } from "./components/Planned";

function App() {
  const listobj = {
    list2: 2,
    list3: 3,
    list4: 4,
    list5: 5,
  };
  const accountObj = {
    userId: 1,
    accountName: "Dev Reshamiya",
    emailId: "reshamiyadev1234@outlook.com",
    profilePic: "sidebar-tempProfilepic.png",
  };
  const infobarobj = {
    genClass: "infoBar infobar-general",
    name: "Leetcode Weekly",
    steps: null,
    remind: new Date(),
    dueDate: new Date(),
    repeat: { freq: "Weekly", on: ["Mon", "Tue"] },
    createdOn: new Date(),
  };

  return (
    /*<Task
      name="UIUX Course"
      dueDate={new Date()}
      important={false}
      repeat={true}
      completed={true}
      taskID="1"
    />*/
    <div className="todoBody">
      <Sidebar
        genClass="sidebar-general"
        userLists={listobj}
        accountInfo={accountObj}
      />
      <Planned />
      <Infobar {...infobarobj} />
    </div>
  );
}

export default App;
